events.event:
//改变现实状态，同时查找和分配空余箱子
BOX_MSG box_info;
$picture_ctrl.win_type_min = 0;
$picture_ctrl.win_type_mid = 0;
$picture_ctrl.win_type_max = 1;

//box_type = ''
if(1 == read_box_info_status_type(BOX_IDLE , BOX_TYPE_MAX , &box_info))
{
    //有剩余的箱子
    $box_msg.station_num = box_info.station_num;//记录排列号
    $box_msg.type = BOX_TYPE_MAX;
}
else
{
    strcpy($picture_ctrl.win_tip , "无该型号的箱子可用");
    $picture_ctrl.win_type_max = 0;
    $$HmiCommit;
    hmi_window_show("win_tip");
}

//改变现实状态，同时查找和分配空余箱子
BOX_MSG box_info;
$picture_ctrl.win_type_min = 0;
$picture_ctrl.win_type_mid = 1;
$picture_ctrl.win_type_max = 0;

//box_type = ''
if(1 == read_box_info_status_type(BOX_IDLE , BOX_TYPE_MID , &box_info))
{
    //有剩余的箱子
    $box_msg.station_num = box_info.station_num;//记录排列号
    $box_msg.type = BOX_TYPE_MID;
}
else
{
    strcpy($picture_ctrl.win_tip , "无该型号的箱子可用");
    $picture_ctrl.win_type_mid = 0;
    $$HmiCommit;
    hmi_window_show("win_tip");
}

//改变现实状态，同时查找和分配空余箱子
BOX_MSG box_info;
$picture_ctrl.win_type_min = 1;
$picture_ctrl.win_type_mid = 0;
$picture_ctrl.win_type_max = 0;

//box_type = ''
if(1 == read_box_info_status_type(BOX_IDLE , BOX_TYPE_MIN , &box_info))
{
    //有剩余的箱子
    $box_msg.station_num = box_info.station_num;//记录排列号
    $box_msg.type = BOX_TYPE_MIN;
}
else
{
    strcpy($picture_ctrl.win_tip , "无该型号的箱子可用");
    $picture_ctrl.win_type_min = 0;
    $$HmiCommit;
    hmi_window_show("win_tip");
}

//检查各个信息是否正常，发送数据到服务器，并等待服务器返回
BOX_MSG box_info;
int data_len;
unsigned char data_buf[128];
if(($picture_ctrl.win_type_min == 0) && ($picture_ctrl.win_type_mid == 0) && ($picture_ctrl.win_type_max == 0))
{
    strcpy($picture_ctrl.win_tip , "请选择箱子类型");
    $$HmiCommit;
    hmi_window_show("win_tip");
    return;
}

read_box_info_station_num($box_msg.station_num , &box_info);
//写入需要传递的用户信息,运货员卡号，订单号，用户手机号，箱子型号
memset(box_info.send_num , 0xff , SEND_NUM_LENGTH);
memcpy(box_info.send_num , $box_msg.send_num , strlen($box_msg.send_num));
memset(box_info.send_id , 0xff , SENDID_LENGTH);
memcpy(box_info.send_id , $box_msg.send_id , strlen($box_msg.send_id));
memset(box_info.user_phnum , 0xff , USER_PHNUM_LENGTH);
memcpy(box_info.user_phnum , $box_msg.user_phnum , strlen($box_msg.user_phnum));//复制用户手机号
box_info.type = $box_msg.type;//箱子型号
data_len = package_user_data_pack(data_buf , OPEN_ASK , &box_info);//封装数据部分
package_send_pack($sys_set.send_pack , $sys_set.station_add ,SAVE_USER_INFO , data_buf , data_len);//封装整包
$sys_set.send_pack_flag = 1;//发送包
$picture_ctrl.win_save_next_flag = 1;

hmi_window_hide("win_input_pnum_type");
hmi_window_hide("win_input_send_tm");
strcpy($picture_ctrl.win_wait_tip,"后台处理中，请耐心等待");
$picture_ctrl.win_wait_sw = 0;
//$sys_set.user_ic_enable_flag = 1;
$$HmiCommit;
hmi_window_show("win_wait_tip");

debug_printf("box_msg.send_id = %s\n",$box_msg.send_id);
debug_printf("box_msg.user_phnum = %s\n",$box_msg.user_phnum);
debug_printf("box_msg = %c\n",$box_msg.type);

$sys_set.send_tm_enable_flag = 0;//禁止条码读取
$picture_ctrl.win_save_next_flag = 0;//禁止出现继续存物
hmi_window_hide("TextKeyboard6");
